data.value:
i – номер частотного интервала интегрирования(суммирования), в пределах которого проводится расчет показателя эффективности защиты информации; 
fнi, fвi – рассчитанные значения частот нижней и верхней границы i-го частотного интервала интегрирования (суммирования) соответственно, в пределах которого проводится расчет показателя эффективности защиты информации, МГЦ;
fj,– измеренные  значения частот спектральных компонент тестового сигнала с дискретным спектром, МГц;
E(с+ш)i, pH(с+ш)i, – измеренные в опорной точке на частотах fj в пределах i-го частотного интервала суммирования значения суммарной напряженности электрического (магнитного) поля тестового сигнала с дискретным спектром и шума, при которых было получено Eсiмах, pHсiмах при изменении ɑ от 0° до 330° с шагом 30°, мкВ/м;
Eшi, pHшi, – измеренные в опорной точке на частотах fj в пределах i-го частотного интервала суммирования значения суммарной напряженности электрического (магнитного) поля тестового сигнала с дискретным спектром и шума, при которых было получено Eсiмах, pHсiмах при изменении ɑ от 0° до 330° с шагом 30°,  мкВ/м;
e(с+ш)i, ph(с+ш)i, – измеренные в опорной точке на центральных частотах f в пределах i-го частотного интервала интегрирования значения суммарной спектральной плотности напряженности электрического (магнитного) поля тестового сигнала со сплошным и смешанным спектром и шума, при которых было получено Eсiмах, pHсiмах при изменении ɑ от 0° до 330° с шагом 30°,   мкВ/(м√кГц));
eшi, phшi, – измеренные в опорной точке на центральных частотах f в пределах i-го частотного интервала интегрирования значения спектральной плотности напряженности электрического (магнитного) поля шума, при которых было получено Eсiмах, pHсiмах при изменении ɑ от 0° до 330° с шагом 30°,  мкВ/(м√кГц));
Eсiмах, pHсiмах – рассчитанные в опорной точке в пределах i-го частотного интервала интегрирования (суммирования) максимальные значения интервальной напряженности электрического (магнитного) поля тестового сигнала, мкВ/м;
* - при сплошном и смешанном спектре сигнала расчет напряженности электрического (магнитного) поля тестового сигнала проводится для каждого i-го частотного интервала интегрирования, в столбце fj ставится “—”.

i – номер частотного интервала интегрирования(суммирования), в пределах которого проводится расчет показателя эффективности защиты информации; 
Δi – рассчитанные в опорной точке в пределах i-го частотного интервала интегрирования значения показателя эффективности защиты информации по напряженности электрического (магнитного) поля;
R2стi,R2возi, R2носi  – размер зоны 2, определенный в ходе проведения СИ для заданной категории СВТ и вида аппаратуры разведки ПЭМИН,м.

